ont-family:서울한강체 EB"><span style="font-weight:bold"><span style="color:#0059ff">백인제가옥의 숨겨진 비밀을 찾아라</span></span></span><span lang="EN-US"><span style="font-family:서울한강체 EB"><span style="letter-spacing:0pt"><span style="font-weight:bold"><span style="color:#0059ff">!</span></span></span></span></span></span></span></span><span style="font-size:28px;"><br />  <span style="word-break:keep-all">&nbsp;</span></span><br />  <span style="font-size:18px;"><span style="font-family:서울남산체 EB">서울역사박물관</span><span lang="EN-US" style="font-family:서울남산체 EB"><span style="letter-spacing:0pt">(</span></span><span style="font-family:서울남산체 EB">관장 김용석</span><span lang="EN-US" style="font-family:서울남산체 EB"><span style="letter-spacing:0pt">) </span></span><span style="font-family:서울남산체 EB">분관인 백인제가옥은 초등학생</span><span lang="EN-US" style="font-family:서울남산체 EB"><span style="letter-spacing:0pt">(</span></span><span style="font-family:서울남산체 EB">전 학년</span><span lang="EN-US" style="font-family:서울남산체 EB"><span style="letter-spacing:0pt">)</span></span><span style="font-family:서울남산체 EB">과 학부모를 위해 </span><span lang="EN-US" style="font-family:서울남산체 EB"><span style="letter-spacing:0pt">&lsquo;</span></span><span style="font-family:서울남산체 EB">백인제가옥의 숨겨진 비밀을 찾아라</span><span lang="EN-US" style="font-family:서울남산체 EB"><span style="letter-spacing:0pt">!&rsquo; </span></span><span style="font-family:서울남산체 EB">온라인 교육을 마련하였습니다</span><span lang="EN-US" style="font-family:서울남산체 EB"><span style="letter-spacing:0pt">. </span></span><u style="text-underline:#000000 single"><span style="font-family:서울남산체 EB"><span style="font-weight:bold">이 프로그램은 선발된 교육생의 집으로 배송된 활동지와 교구재를 가지고 진행하는 실시간 원격 화상교육 수업입니다</span></span></u><span lang="EN-US" style="font-family:서울남산체 EB"><span style="letter-spacing:0pt">. </span></span><span style="font-family:서울남산체 EB">해당 교육에서는 백인제가옥이 근대한옥으로서 지닌 건축적 특징을 함께 찾아보고</span><span lang="EN-US" style="font-family:서울남산체 EB"><span style="letter-spacing:0pt">, </span></span><span style="font-family:서울